import React from 'react';

const home = () => {
    return (
       <main>
          <h1>Hear Your World</h1>
          <button>Take Our Hearing Screening</button>
          <button>Begin Your Hearing Journey</button>
           <p>OUR STORY Sound Sustainability is a Seattle-based medical device startup founded by a hearing-impaired Army veteran. Our mission is to improve hearing health for everyone by educating, engaging, and increasing access. We believe that everyone has the right to hear.</p>

       </main>
    );
}

export default home;
